}# Mail Templates

When [logging in](https://www.xwiki.org/xwiki/bin/view/Documentation/UserGuide/Features/Authentication#HLoggingin), you have the option of resetting your user&#x27;s password if you forgot it, or to find your username based on your email address. When choosing these options, you&#x27;ll be sent an email. It&#x27;s possible to control the templates used for these emails and to customize them by editing the following pages in object mode:

* XWiki.ResetPasswordMailContent
* XWiki.ForgotUsernameMailContent
